      <text id="93" justification="0" size="4" underlined="false">
        <text>Main&apos;s primary purpose is to:

- Load Control</text>

      <children id="96"/>

      <revision>1</revision>
      <backgroundColor reference="91"/>
      <borderColor reference="92"/>
      <textColor reference="92"/>
      <text id="99" justification="0" size="4" underlined="false">
        <text>Control 
- creates a generic bridge
- passes the bridge a sloop, yawl or ketch
- this makes a generic bridge a sloopBridge or yawlBridge or ketchBridge
- Uses a single bridge to give commands to different boats</text>
      </text>
      <color reference="94"/>
    </NoteNode>
    <NoteNode id="100">
      <children id="101"/>
      <location class="Point2D.Double" id="102" x="20.0" y="250.0"/>
      <id id="103" value="eba63a57-f258-45c4-a5af-7db6c363da0b"/>
      <revision>1</revision>
      <backgroundColor reference="91"/>
      <borderColor reference="92"/>
      <textColor reference="92"/>
      <text id="104" justification="0" size="4" underlined="false">
        <text>Bridge:
- Act as intermediary between Control and boats
- Provide a single object that acts in multiple ways.
- Promotes loose coupling
</text>
      </text>
      <color reference="94"/>
    </NoteNode>
    <NoteNode id="105">
      <children id="106"/>
      <location class="Point2D.Double" id="107" x="30.0" y="550.0"/>
      <id id="108" value="46640f18-8762-4633-9fe6-b2f36d4104c4"/>
      <revision>1</revision>
      <backgroundColor reference="91"/>
      <borderColor reference="92"/>
      <textColor reference="92"/>
      <text id="109" justification="0" size="4" underlined="false">
        <text>An expert bridge provides 
a way to change how boats 
behave without having to 
change either Control (the 
main program) or the boat.</text>
      </text>
      <color reference="94"/>
    </NoteNode>
    <NoteNode id="110">
      <children id="111"/>
      <location class="Point2D.Double" id="112" x="600.0" y="390.0"/>
      <id id="113" value="98312e8d-27d1-434b-9dc5-e697ff92a8a8"/>
      <revision>1</revision>
      <backgroundColor reference="91"/>
      <borderColor reference="92"/>
      <textColor reference="92"/>
      <text id="114" justification="0" size="4" underlined="false">
        <text>Boats are:
- Loosely coupled to the main program (Control)
- Modular
- Able to change without impacting main program
- Able to be tested separately from the main program</text>
      </text>
      <color reference="94"/>
    </NoteNode>
    <NoteNode id="115">
      <children id="116"/>
      <location class="Point2D.Double" id="117" x="600.0" y="700.0"/>
      <id id="118" value="469bb83c-24ea-4de2-a654-10767717da2d"/>
      <revision>1</revision>
      <backgroundColor reference="91"/>
      <borderColor reference="92"/>
      <textColor reference="92"/>
      <text id="119" justification="0" size="4" underlined="false">
        <text>When a boat tacks through a SailorBridgeExpert it 
does special things that it does not do when it tacks 
through the SailorBridge. We are able to modify
boats by changing the boats themselves, or
by changing the SailorBridgeExpert. None of this 
affects the implementation of the main program.
Furthermore, changes to the expert do not change
the implementation of the boat.</text>
      </text>
      <color reference="94"/>
    </NoteNode>
